import React from "react";
import { Button } from "@mui/material";

import styles from "./styles.module.scss";

const Home = () => {
	const handleRestaurants = () => alert("1");
	const handleOrderStatus = () => alert("2");
	return (
		<div className={styles.container}>
			<span className={styles.label}> Bienvenido! </span>
			&nbsp 
			<Button onClick={handleRestaurants}>Ver restaurantes cercanos</Button>
			<Button onClick={handleOrderStatus}>Ver estado de pedido</Button>
		</div>
	);
};

export default Home;
